store.subscribe(() => {
  console.log(store.getState());
});
store.dispatch(addBlog({ itemTitle: "Hello", itemDesc: "Hello desk" }));
store.dispatch(addBlog({ itemTitle: "Mello", itemDesc: "Mello desk" }));

